class Solution:
    ## works but TLE 
    def longestOnes(self, nums: list[int], k: int) -> int:
        n = len(nums)
        max_window = 0
        for i in range(n):
            zero_count = 0
            one_count = 0
            j = i
            while j < n:
                if zero_count < k:
                    if nums[j] == 0:
                        zero_count+=1
                    else: 
                        one_count += 1
                    j+=1
                elif zero_count == k:
                    if nums[j] == 0:
                        max_window = max(max_window,one_count+zero_count)
                        break
                    else: 
                        one_count += 1
                    j+=1
            max_window = max(max_window,one_count+zero_count)
        return max_window
    # O(N) time, O(1) SPACE
    def longestOnes(self, nums: list[int], k: int) -> int:
        max_w = 0
        zero_count = 0
        l = 0
        n = len(nums)

        for r in range(n):
            if nums[r] == 0:
                zero_count += 1
            while zero_count > k:
                if nums[l] == 0:
                    zero_count -= 1
                l += 1
            max_w = max(max_w,r-l+1)
        return max_w
            
            






